import React from 'react'
import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'
function RenderRow({ row }) {
        var rowvals={row}.toString().split("").map((x)=>+x);
        return(
            <div>
                {{row}.map((item)=>{
                    <span>Item={item}  </span>
                })}
            </div>
        )
}
const Ticket = ({ row1,row2,row3 }) => {
    console.log(row1);
    return (
        <div>
            <h1><RenderRow row={row1}/></h1>
        </div>
    )
}
export default Ticket;
